import React from 'react';
import contact from '../../Assets/contact.jpg';
import styles from './Contato.module.css';

const Contato = () => {
  return (
    <section>
      <div className=''>
        <img src={contact} alt="Contato" />
      </div>
    </section>
  )
}

export default Contato;
